import React from 'react';
import styled from 'styled-components';

type ListProps<T> = {
    children: T
};

const ListContent = styled.li`
    margin: 10px;
`;

const List = <T extends []>({children}: ListProps<T>) => {
    let listContainment  = children;
    return <ul>
        {listContainment.map((content) => (
            <ListContent>{content}</ListContent>
        ))}
    </ul>
};

export default List;
